(18, 62, 'Lightbox', 'lightbox', '', '\r\n<div class="content clearfix">\r\n<p>The Widgetkit Lightbox allows you to view images, HTML and multi-media content on a dark dimmed overlay without having to leave the current page.</p><br />\r\n<h2>Examples</h2>\r\n<p>Different animations - <code>fade</code>, <code>elastic</code> and <code>none</code></p>\r\n<p class="gallery"><a data-lightbox="transitionIn:fade;transitionOut:fade;" href="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image1_lightbox.jpg"><img src="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image1.jpg" border="0" alt="Lightbox Image" width="180" height="120" /></a> <a data-lightbox="transitionIn:elastic;transitionOut:elastic;" href="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image2_lightbox.jpg"><img src="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image2.jpg" border="0" alt="Lightbox Image" width="180" height="120" /></a> <a data-lightbox="transitionIn:none;transitionOut:none;" href="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image3_lightbox.jpg"><img src="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image3.jpg" border="0" alt="Lightbox Image" width="180" height="120" /></a></p>\r\n<p>Different title positions - <code>float</code>, <code>inside</code> and <code>over</code></p>\r\n<p class="gallery"><a data-lightbox="group:mygroup1;titlePosition:float" href="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image4_lightbox.jpg" title="Title Position: Float"><img src="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image4.jpg" border="0" alt="Lightbox Image" width="180" height="120" /></a> <a data-lightbox="group:mygroup1;titlePosition:inside" href="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image5_lightbox.jpg" title="Title Position: Inside"><img src="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image5.jpg" border="0" alt="Lightbox Image" width="180" height="120" /></a> <a data-lightbox="group:mygroup1;titlePosition:over;padding:0" href="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image6_lightbox.jpg" title="Title Position: Over and Padding set to 0"><img src="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image6.jpg" border="0" alt="Lightbox Image" width="180" height="120" /></a></p>\r\n<p>Various examples in one gallery (try also using the keyboard and mouse scroll wheel)</p>\r\n<ul>\r\n<li><a data-lightbox="group:mygroup2" href="http://www.youtube.com/watch?v=R55e-uHQna0" title="YouTube Video">YouTube</a></li>\r\n<li><a data-lightbox="group:mygroup2" href="http://vimeo.com/15261921" title="Vimeo Video">Vimeo</a></li>\r\n<li><a data-lightbox="group:mygroup2;autoplay:true;" href="http://www.yootheme.com/videos/mediaplayer.mp4" title="MP4 (h.264)">MP4 (h.264)</a></li>\r\n<li><a data-lightbox="group:mygroup2" href="http://www.adobe.com/jp/events/cs3_web_edition_tour/swfs/perform.swf" title="Flash Swf">Swf</a></li>\r\n<li><a data-lightbox="group:mygroup2" href="http://www.yootheme.com/widgetkit/examples/lightbox#inline" title="Inline Content from the Website">Inline</a></li>\r\n<li><a data-lightbox="group:mygroup2;width:1000;height:600" href="http://www.wikipedia.org" title="Iframe">Iframe</a></li>\r\n</ul><br />\r\n<h2>Features</h2>\r\n<ul class="check">\r\n<li>Display images, videos, HTML, Iframes, Ajax requests and SWF</li>\r\n<li>Supports YouTube, Vimeo, MP4 (h.264), WebM and FLV movies</li>\r\n<li>Group lightboxes and mix different content types</li>\r\n<li>Responsive design to fit all device resolutions</li>\r\n<li>Load other widgets in lightbox</li>\r\n<li>3 different opening and closing transitions</li>\r\n<li>4 different caption styles</li>\r\n<li>Keyboard and mouse scroll wheel navigation</li>\r\n<li>Build on the latest jQuery version</li>\r\n<li>Works with Joomla and WordPress</li>\r\n</ul><br />\r\n<h2>Load Widgets In A Lightbox</h2>\r\n<p>Use <code>#wk-ID</code> to load widgets like slideshows or galleries in a lightbox. For example: <a data-lightbox="width:600;height:300;" href="http://www.yootheme.com/widgetkit/examples/lightbox#wk-50" title="Widgetkit Slideshow">Widgetkit Slideshow</a></p>\r\n<pre>&lt;a data-lightbox="width:600;height:300;" href="#wk-10"&gt;Lightbox&lt;/a&gt;</pre><br />\r\n<h2>How To Use</h2>\r\n<p>Use the HTML5 custom data attribute <code>data-lightbox</code> to activate the lightbox. You can set various lightbox parameters to the data attribute. For example:</p>\r\n<pre><code>&lt;a data-lightbox="width:1000;height:600;" href="http://www.wikipedia.org"&gt;Lightbox&lt;/a&gt;</code></pre>\r\n<p>Here is a list of the most common parameters:</p>\r\n<ul>\r\n<li><strong>titlePosition</strong> - How should the title show up? (<code>float</code>, <code>outside</code>, <code>inside</code> or <code>over</code>)</li>\r\n<li><strong>transitionIn</strong> - Set a opening transition. (<code>fade</code>, <code>elastic</code>, or <code>none</code>)</li>\r\n<li><strong>transitionOut</strong> - Set a closing transition (<code>fade</code>, <code>elastic</code>, or <code>none</code>)</li>\r\n<li><strong>overlayShow</strong> - Set to <code>true</code> or <code>false</code></li>\r\n<li><strong>scrolling</strong> - Set to <code>yes</code> or <code>no</code></li>\r\n<li><strong>width</strong> - Set a width in pixel</li>\r\n<li><strong>height</strong> - Set a height in pixel</li>\r\n<li><strong>padding</strong> - Set a padding in pixel</li>\r\n</ul>\r\n</div>', '', 1, 0, 0, 2, '2013-04-12 09:47:40', 394, '', '2013-04-12 10:08:42', 229, 0, '0000-00-00 00:00:00', '2013-04-12 09:47:40', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 0, 2, '', '', 1, 7, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(19, 63, 'Spotlight', 'spotlight', '', '<div class="content clearfix">\r\n<p>The Widgetkit Spotlight allows you to add an overlay to your images which fades or moves in on mouse hover. The overlay can be an image or HTML content. The default magnifier spotlight is a perfect match to be used with a lightbox.</p><br />\r\n<h2>Examples</h2>\r\n<p>If no custom overlay is set the default spotlight fades in an overlay with an magnifier image. If you define a custom overlay you can choose between different animations - <code>fade</code>, <code>bottom</code>, <code>top</code>, <code>right</code> and <code>left</code>.</p><br />\r\n<div><a data-lightbox="transitionIn:elastic;transitionOut:elastic;" class="spotlight" href="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image1_lightbox.jpg" style="position: relative; overflow: hidden;" data-spotlight="on"> <img src="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image1.jpg" border="0" alt="Spotlight Image" width="180" height="120" /> </a> <a data-lightbox="transitionIn:elastic;transitionOut:elastic;" class="spotlight" href="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image2_lightbox.jpg" style="position: relative; overflow: hidden;" data-spotlight="effect:bottom;"> <img src="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image2.jpg" border="0" alt="Spotlight Image" width="180" height="120" /> <span class="overlay" style="position: absolute; visibility: visible; display: block; width: 180px; height: auto; left: 0px; bottom: -60px;">Custom Overlay (Bottom)</span> </a> <a data-lightbox="transitionIn:elastic;transitionOut:elastic;" class="spotlight" href="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image3_lightbox.jpg" style="position: relative; overflow: hidden;" data-spotlight="effect:right;"> <img src="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image3.jpg" border="0" alt="Spotlight Image" width="180" height="120" /> <span class="overlay" style="position: absolute; visibility: visible; display: block; width: 180px; height: 120px; right: -180px; top: 0px; bottom: 0px;">Custom Overlay (Right)</span> </a></div>\r\n<div><a data-lightbox="transitionIn:elastic;transitionOut:elastic;" class="spotlight" href="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image4_lightbox.jpg" style="position: relative; overflow: hidden;" data-spotlight="effect:fade;"> <img src="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image4.jpg" border="0" alt="Spotlight Image" width="180" height="120" /> <span class="overlay remove-padding" style="position: absolute; visibility: visible; display: none; width: 180px; height: 120px; opacity: 0; top: 0px; left: 0px;"><img src="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image4_spotlight.jpg" border="0" alt="Spotlight Image" width="180" height="120" /></span> </a> <a data-lightbox="transitionIn:elastic;transitionOut:elastic;" class="spotlight" href="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image5_lightbox.jpg" style="position: relative; overflow: hidden;" data-spotlight="effect:top;"> <img src="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image5.jpg" border="0" alt="Spotlight Image" width="180" height="120" /> <span class="overlay" style="position: absolute; visibility: visible; display: block; width: 180px; height: auto; left: 0px; top: -40px;">Custom Overlay (Top)</span> </a> <a data-lightbox="transitionIn:elastic;transitionOut:elastic;" class="spotlight" href="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image6_lightbox.jpg" style="position: relative; overflow: hidden;" data-spotlight="effect:left;"> <img src="http://www.yootheme.com/images/yootheme/widgetkit/lightbox/image6.jpg" border="0" alt="Spotlight Image" width="180" height="120" /> <span class="overlay" style="position: absolute; visibility: visible; display: block; width: 180px; height: 120px; left: -180px; top: 0px; bottom: 0px;">Custom Overlay (Left)</span> </a></div>\r\n</div><br />\r\n<h2>Features</h2>\r\n<ul class="check">\r\n<li>Create nicely animated image overlays</li>\r\n<li>Supports custom image or HTML content overlays</li>\r\n<li>5 different animation modes</li>\r\n<li>Responsive design to fit all device resolutions</li>\r\n<li>Built with the latest jQuery version</li>\r\n<li>Works with Joomla and WordPress</li>\r\n</ul><br />\r\n<h2>How To Use</h2>\r\n<p>Use the HTML5 custom data attribute <code>data-spotlight</code> to activate the spotlight.</p>\r\n<pre>&lt;a data-spotlight="on" href="/mypage.html"&gt;\r\n	&lt;img src="/image.jpg" width="180" height="120" alt="" /&gt;\r\n&lt;/a&gt;</pre>\r\n<p>To create a custom overlay use a div element with the CSS class <code>overlay</code>. You can set the effect parameter to the data attribute. For example:</p>\r\n<pre>&lt;a data-spotlight="effect:bottom;" href="/mypage.html"&gt;\r\n	&lt;img src="/image.jpg" width="180" height="120" alt="" /&gt;\r\n	&lt;span class="overlay"&gt;Custom Overlay&lt;/span&gt;\r\n&lt;/a&gt;</pre>\r\n<p>You can set the effect parameter to <code>fade</code>, <code>bottom</code>, <code>top</code>, <code>right</code> and <code>left</code>.</p>\r\n', '', 1, 0, 0, 2, '2013-04-12 09:48:24', 394, '', '2013-04-12 10:06:50', 229, 0, '0000-00-00 00:00:00', '2013-04-12 09:48:24', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 3, 0, 1, '', '', 1, 12, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(20, 64, 'Media Player', 'media-player', '', '<p>The Widgetkit Media Player is a HTML5 audio and video player completely built HTML and CSS. You can easily embed video files into your website by using the HTML5 video element. A Flash player fallback is included for all unsupported browsers.</p><br />\r\n<h2>Examples</h2>\r\n<video width="640" height="360" preload="none" poster="http://www.yootheme.com/videos/mediaplayer.jpg" tabindex="0" style="display: none;">\r\n<source src="http://www.yootheme.com/videos/mediaplayer.mp4" type="video/mp4"></source>\r\n</video><br />\r\n<p>This is a MP3 Audio Sample:</p>\r\n<audio preload="none" type="audio/mp3" src="http://www.yootheme.com/videos/mediaplayer.mp3" tabindex="0" style="display: none;"></audio><br />\r\n<h2>Features</h2>\r\n<ul class="check">\r\n<li>Native playback for modern HTML5 browsers</li>\r\n<li>Supports MP4 (h.264), WebM, FLV, WMV and MP3 files</li>\r\n<li>Completely built with HTML and CSS</li>\r\n<li>Responsive design to fit all device resolutions</li>\r\n<li>Same UI in all browsers</li>\r\n<li>Create your own skins</li>\r\n<li>Flash player fallback for unsupported browsers</li>\r\n<li>Works with Joomla and WordPress</li>\r\n</ul><br />\r\n<h2>How To Use</h2>\r\n<p>Use the HTML5 <code>video</code> element to embed video in your website. For example:</p>\r\n<pre>&lt;video src="/video.mp4" width="320" height="240"&gt;&lt;/video&gt;</pre>\r\n<p>You can also provide multiple sources, to add support for the different video formats like h.264, WebM or Ogg:</p>\r\n<pre>&lt;video width="320" height="240"&gt;\r\n	&lt;source type="video/mp4"  src="/video.mp4" /&gt;\r\n	&lt;source type="video/webm" src="/video.webm" /&gt;\r\n	&lt;source type="video/ogg"  src="/video.ogv" /&gt;\r\n&lt;/video&gt;\r\n</pre>\r\n<p>Use the HTML5 <code>audio</code> element to embed MP3 files in your website. For example:</p>\r\n<pre>&lt;audio src="/audio.mp3" type="audio/mp3"&gt;&lt;/audio&gt;</pre>\r\n<h2> </h2>', '', 1, 0, 0, 2, '2013-04-12 09:48:44', 394, '', '2013-04-12 10:01:56', 229, 0, '0000-00-00 00:00:00', '2013-04-12 09:48:44', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 10, 0, 0, '', '', 1, 17, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
