(120, 'CTA Buttons (Portfolio, Contact)', '', '<div class="jfx_action">\r\n<h1>We Design and Develop Beautiful Templates for Business and Creative Websites!</h1>\r\n<h2>You can check out our amazing <a href="index.php/features/portfolio">portfolio</a> or you can simply <a href="index.php/features/contact-us">contact us</a> for more information.</h2>\r\n</div>', 1, 'maintop-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
