(158, 'Tabs GK5 - Style 1', '', '', 1, 'maintop-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_tabs_gk5', 1, 1, '{"automatic_module_id":"1","module_id":"gk-tab-1","moduleclass_sfx":"style1","module_data_source":"tabsmanager","tabs_data":"[{\\"name\\":\\"Tab1\\",\\"type\\":\\"xhtml\\",\\"content\\":\\"The Tabs GK5 module is the next evolutionary step forward in the GavickPro solution to managing Web page content via tabs.[leftbracket]br[rightbracket][leftbracket]\\/br[rightbracket]\\\\nTabs GK5 introduces support for external data sources in the JSON and XML formats, and it includes options for vertical tabs layout and for automatic height adjustment based upon the content. This version is also scalable, making it appropriate for websites based upon Responsive Web Design.[leftbracket]br[rightbracket][leftbracket]\\/br[rightbracket]\\\\nTabs GK5 supports the now-standard \\u201cModule suffix\\u201d function, which allows unique CSS-based styling to be assigned to the module.[leftbracket]br[rightbracket][leftbracket]\\/br[rightbracket]\\\\nYou can load HTML as well as Modules in the Tabs GK5 Module.[leftbracket]br[rightbracket][leftbracket]\\/br[rightbracket]\\\\nThe \\u201cAnimation\\u201d tab is used to specify animation parameters through the following options: \\u201cAnimation speed\\u201d, \\u201cAnimation interval\\u201d and \\u201cAnimation transition\\u201d. These three parameters specify the rate of speed of an animation, the length of intervals between animations when \\u201cAuto animation\\u201d is in the on position, and animation transition (the way in which animated values change), respectfully.[leftbracket]br[rightbracket][leftbracket]\\/br[rightbracket]\\\\nYou have three different animation types - Opacity, Slider (vertical) and Slider (horizontal).\\",\\"published\\":\\"1\\",\\"access\\":\\"1\\",\\"id\\":\\"\\",\\"animation\\":\\"opacity\\"},{\\"name\\":\\"Tab2\\",\\"type\\":\\"xhtml\\",\\"content\\":\\"The Tabs GK